        public List<Candidato> BuscarCandidatosPorDistrito(int distrito)
        {
            string distritoString = "DISTRITO ";
            if(distrito < 10)
            {
                distritoString = distritoString + "0" + distrito.ToString();
            }
            else
            {
                distritoString = distritoString + distrito.ToString();
            }
            List<Candidato> salida = this.candidatos.Where(x => x.DISTRITO == distritoString).ToList();
            return salida;
        }

